import React from 'react';
import './styles.css';
import logo from './logo.svg'
import NavBar from './components/NavBar';
import { Navbar, NavItem } from 'react-materialize' 

function App() {
  return (
    <div className="App">
      <Navbar 
        className="Navbar"
        alignLinks="right"
        brand={<img className="brand-logo" src={logo}/>}
        id="mobile-nav"
        menuIcon={<p>menu</p>}
        options={{
          draggable: true,
          edge: 'left',
          inDuration: 250,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 200,
          preventScrolling: true
        }}
      >
        <NavItem>
          Hello
        </NavItem>
        <NavItem>
          World!
        </NavItem>
      </Navbar>
    </div>
  );
}

export default App;
